import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav style={{ padding: "10px", background: "#eee" }}>
      <Link to="/materiales" style={{ marginRight: "20px" }}>Materiales</Link>
      <Link to="/marcas"  style={{ marginRight: "20px" }}>Marcas</Link>
      <Link to="/bolsos">Bolsos</Link>
    </nav>


  );
}

export default Navbar;
